import React from "react";

function footer() {
  return (
    <div>
      <footer className="main-footer">
        <strong>
          Copyright &copy;
          <a href="/">NFT</a>.
        </strong>
        All rights reserved.
        <div className="float-right d-none d-sm-inline-block"></div>
      </footer>
    </div>
  );
}

export default footer;
